import  './Category.css'

const Category = ({FilterCategory, ForCategory}) => {

const Fcategory = (cat) =>{

  FilterCategory(cat)
}

  return (
    <div className='Category'>

    {
      ForCategory.length >=1? (ForCategory.map((cat)=>{
        return(<div className="">
        <button style={{border:'2px solid #b45b35'}} onClick={()=> CategoryList(cat)} className="btn mx-2">{cat}</button> 
       </div>)
    })) : (<h1>not found</h1>)   
}
    <button type="button" className="btn btn-primary me-3">All</button>
    <button type="button" onClick={()=>Fcategory('Technologie')} className="btn btn-secondary me-3"><i class="fa-solid fa-laptop-mobile"></i>Technologie</button>
     <button type="button" onClick={()=>Fcategory('Men')} className="btn btn-danger me-3">Men</button>
     <button type="button" onClick={()=>Fcategory('Women')} className="btn btn-info">Women</button>
      </div>
  )
}

export default Category
